import React from 'react';
import VideoItem from './VideoItem';

const VideoList = ({videos}) => {

    const renderdList = videos.map((video) => {
        return (
            <div className="ui relaxed.divided list">
                <VideoItem video={video}/>
            </div>
        )
    });

    return (
        <div>
            {renderdList}
        </div>
    )
};

export default VideoList;
